tains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.";s:15:"gettext_context";s:0:"";}i:77;O:8:"stdClass":6:{s:2:"id";s:4:"5524";s:6:"status";N;s:3:"ctx";s:32:"449caefc4319d4e355a74cfbc0831768";s:10:"translated";N;s:8:"original";s:20:"Removing and Reusing";s:15:"gettext_context";s:0:"";}i:78;O:8:"stdClass":6:{s:2:"id";s:4:"5525";s:6:"status";N;s:3:"ctx";s:32:"f5f6f5978f1a37ee120927289f3f6f8d";s:10:"translated";N;s:8:"original";s:257:"If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.";s:15:"gettext_context";s:0:"";}i:79;O:8:"stdClass":6:{s:2:"id";s:4:"5526";s:6:"status";N;s:3:"ctx";s:32:"cb26d608dcaf5e53bfdccbb076ee7f6b";s:10:"translated";N;s:8:"original";s:123:"Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.";s:15:"gettext_context";s:0:"";}i:80;O:8:"stdClass":6:{s:2:"id";s:4:"5527";s:6:"status";N;s:3:"ctx";s:32:"ac9278c82439b66854fc13fb321c96e5";s:10:"translated";N;s:8:"original";s:119:"Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.";s:15:"gettext_context";s:0:"";}i:81;O:8:"stdClass":6:{s:2:"id";s:4:"5528";s:6:"status";N;s:3:"ctx";s:32:"fed26992edec9b0b4e080ce678b8e973";s:10:"translated";N;s:8:"original";s:15:"Missing Widgets";s:15:"gettext_context";s:0:"";}i:82;O:8:"stdClass":6:{s:2:"id";s:4:"5529";s:6:"status";N;s:3:"ctx";s:32:"90a9c622ce04410d1eb4367e50230adf";s:10:"translated";N;s:8:"original";s:276:"Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.";s:15:"gettext_context";s:0:"";}i:83;O:8:"stdClass":6:{s:2:"id";s:4:"5530";s:6:"status";N;s:3:"ctx";s:32:"a4018b4b9fa0ad74ac664770d4fa25bd";s:10:"translated";N;s:8:"original";s:347:"When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.";s:15:"gettext_context";s:0:"";}i:84;O:8:"stdClass":6:{s:2:"id";s:4:"5531";s:6:"status";N;s:3:"ctx";s:32:"5f4aa7fdf5af3ac633eda848724fd1bb";s:10:"translated";N;s:8:"original";s:92:"<a href="https://codex.wordpress.org/Appearance_Widgets_Screen">Documentation on Widgets</a>";s:15:"gettext_context";s:0:"";}i:85;O:8:"stdClass":6:{s:2:"id";s:4:"5532";s:6:"status";N;s:3:"ctx";s:32:"c522f6f2f38c5fe50947cad10691b443";s:10:"translated";N;s:8:"original";s:16:"Inactive Widgets";s:15:"gettext_context";s:0:"";}i:86;O:8:"stdClass":6:{s:2:"id";s:4:"5533";s:6:"status";N;s:3:"ctx";s:32:"4558853d2749bc0312b6511c110ab8c1";s:10:"translated";N;s:8:"original";s:74:"Drag widgets here to remove them from the sidebar but keep their settings.";s:15:"gettext_context";s:0:"";}i:87;O:8:"stdClass":6:{s:2:"id";s:4:"5534";s:6:"status";N;s:3:"ctx";s:32:"4645959f81fac9d9cf031b869f001fde";s:10:"translated";N;s:8:"original";s:19:"Error while saving.";s:15:"gettext_context";s:0:"";}i:88;O:8:"stdClass":6:{s:2:"id";s:4:"5535";s:6:"status";N;s:3:"ctx";s:32:"118f946b06e9f84f5fd846d14c561c1c";s:10:"translated";N;s:8:"original";s:45:"Error in displaying the widget settings form.";s:15:"gettext_context";s:0:"";}i:89;O:8:"stdClass":6:{s:2:"id";s:4:"5536";s:6:"status";N;s:3:"ctx";s:32:"f86df510bd