87d617b9d314421f9b5f82205f7f7652";s:10:"translated";N;s:8:"original";s:11:"Newer posts";s:15:"gettext_context";s:0:"";}i:340;O:8:"stdClass":6:{s:2:"id";s:4:"7630";s:6:"status";N;s:3:"ctx";s:32:"4d2a19eee3a8c43c3d369e6f29abf1e9";s:10:"translated";N;s:8:"original";s:16:"Posts navigation";s:15:"gettext_context";s:0:"";}i:341;O:8:"stdClass":6:{s:2:"id";s:4:"7631";s:6:"status";N;s:3:"ctx";s:32:"fed10a089b08ede8b1c9282f75d77dfa";s:10:"translated";N;s:8:"original";s:15:"RECENTE STORIES";s:15:"gettext_context";s:0:"";}i:342;O:8:"stdClass":6:{s:2:"id";s:4:"7632";s:6:"status";N;s:3:"ctx";s:32:"4e0ba481e97cbec7303c0ce0e1fd36a0";s:10:"translated";N;s:8:"original";s:15:"Recent articles";s:15:"gettext_context";s:0:"";}i:343;O:8:"stdClass":6:{s:2:"id";s:4:"7633";s:6:"status";N;s:3:"ctx";s:32:"7c75a00978f0656536acbc67c5e7d458";s:10:"translated";N;s:8:"original";s:6:"Recent";s:15:"gettext_context";s:0:"";}i:344;O:8:"stdClass":6:{s:2:"id";s:4:"7637";s:6:"status";N;s:3:"ctx";s:32:"df93416910d6e5d402da0166617b2ee4";s:10:"translated";N;s:8:"original";s:172:"You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there&#8217;s no relationship from one tag to another.";s:15:"gettext_context";s:0:"";}i:345;O:8:"stdClass":6:{s:2:"id";s:4:"7638";s:6:"status";N;s:3:"ctx";s:32:"4d97505e61693c0a1aac1b958fe094ac";s:10:"translated";N;s:8:"original";s:382:"What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.";s:15:"gettext_context";s:0:"";}i:346;O:8:"stdClass":6:{s:2:"id";s:4:"7639";s:6:"status";N;s:3:"ctx";s:32:"2c226506d0afbbba1a770a535751b268";s:10:"translated";N;s:8:"original";s:80:"When adding a new tag on this screen, you&#8217;ll fill in the following fields:";s:15:"gettext_context";s:0:"";}i:347;O:8:"stdClass":6:{s:2:"id";s:4:"7640";s:6:"status";N;s:3:"ctx";s:32:"5febbe59b4e8c2b38e143b3cff8ae190";s:10:"translated";N;s:8:"original";s:70:"<strong>Name</strong> &mdash; The name is how it appears on your site.";s:15:"gettext_context";s:0:"";}i:348;O:8:"stdClass":6:{s:2:"id";s:4:"7641";s:6:"status";N;s:3:"ctx";s:32:"97af8d8b956434fb602f37b6e0e53e27";s:10:"translated";N;s:8:"original";s:170:"<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.";s:15:"gettext_context";s:0:"";}i:349;O:8:"stdClass":6:{s:2:"id";s:4:"7642";s:6:"status";N;s:3:"ctx";s:32:"bf0e83818cfea660dd6082860a6da784";s:10:"translated";N;s:8:"original";s:118:"<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.";s:15:"gettext_context";s:0:"";}i:350;O:8:"stdClass":6:{s:2:"id";s:4:"7643";s:6:"status";N;s:3:"ctx";s:32:"59cf444b48715208ad794a188fdb27a3";s:10:"translated";N;s:8:"original";s:159:"You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.";s:15:"gettext_context";s:0:"";}i:351;O:8:"stdClass":6:{s:2:"id";s:4:"7644";s:6:"status";N;s:3:"ctx";s:32:"be2d14ac9176c1c1f226ad8a7bc48aeb";s:10:"translated";N;s:8:"original";s:11:"Adding Tags";s:15:"gettext_context";s:0:"";}i:352;O:8:"stdClass":6:{s:2:"id";s:4:"7645";s:6:"status";N;s:3:"ctx";s:32:"8843d62f4399f35a6b4dd0798c392e3a";s:10:"translated";N;s:8:"original";s:81:"<a href="https://codex.wordpress.org/Posts_Tags_Screen">Documentation on Tags</a>";s:15:"gettext_context";s:0:"";}i:353;O:8:"stdClass":6:{s:2:"id";s:4:"7646";s:6:"status";N;s:3:"ctx";s:32:"78266c74f1846dc6c03e1cee67a2f2e8";s:10:"translated";N;s:8:"original";s:101:"Tags can be selectively converted to categories using the <a href="%s">tag to category converter</a>.";s:15:"gettext_context";s:0:"";}i:354;O:8:"stdClass":6:{s:2:"id";s:4:"7647";s:6:"status";N;s:3:"ctx";s:32:"e0fca0430ff9cd3d6e718b1a25e85f40";s:10:"translated";N;s:8:"original";s:87:"It seems we can&rsquo;t find what you&rsquo;re looking for. Perhaps searching can help.";s:15:"gettext_context";s:0:"";}i:355;O:8:"stdClass":6:{s:2:"id";s:4:"7648";s:6:"status";N;s:3:"ctx";s:32:"bb5a79c93b21b78fcd00d5f827f98581";s:10:"translated";N;s:8:"original";s:13:"Nothing Found";s:15:"gettext_context";s:0:"";}i:356;O:8:"stdClass":6:{s:2:"id";s:4:"7649";s:6:"status";N;s:3:"ctx";s:32:"6af916a756747f54b8d722fa84da733f";s:10:"translated";N;s:8:"original";s:13:"Show comments";s:15:"gettext_context";s:0:"";}i:357;O:8:"stdClass":6:{s:2:"id";s:4:"7650";s:6:"status";N;s:3:"ctx";s:32:"58e0f4bd0db3f201181a24e22518af6b";s:10:"translated";N;s:8:"original";s:194:"You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.";s:15:"gettext_context";s:0:"";}i:358;O:8:"stdClass":6:{s:2:"id";s:4:"7651";s:6:"status";N;s:3:"ctx";s:32:"8348240c846a4cb879a67a7a1e6818ca";s:10:"translated";N;s:8:"original";s:85:"When adding a new category on this screen, you&#8217;ll fill in the following fields:";s:15:"gettext_context";s:0:"";}i:359;O:8:"stdClass":6:{s:2:"id";s:4:"7652";s:6:"status";N;s:3:"ctx";s:32:"eec619c60b3b0a3e38f0069c120d2602";s:10:"translated";N;s:8:"original";s:269:"<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.";s:15:"gettext_context";s:0:"";}i:360;O:8:"stdClass":6:{s:2:"id";s:4:"7653";s:6:"status";N;s:3:"ctx";s:32:"e8d8a9c948afa198effafc6abc6c7516";s:10:"translated";N;s:8:"original";s:17:"Adding Categories";s:15:"gettext_context";s:0:"";}i:361;O:8:"stdClass":6:{s:2:"id";s:4:"7654";s:6:"status";N;s:3:"ctx";s:32:"d779aa7147518694ccbdee2026c25e4f";s:10:"translated";N;s:8:"original";s:93:"<a href="https://codex.wordpress.org/Posts_Categories_Screen">Documentation on Categories</a>";s:15:"gettext_context";s:0:"";}i:362;O:8:"stdClass":6:{s:2:"id";s:4:"7655";s:6:"status";N;s:3:"ctx";s:32:"eca83cec51d51a36d40d677c793520b2";s:10:"translated";N;s:8:"original";s:160:"Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have children categories for Bebop and Big Band. Totally optional.";s:15:"gettext_context";s:0:"";}i:363;O:8:"stdClass":6:{s:2:"id";s:4:"7656";s:6:"status";N;s:3:"ctx";s:32:"d2b179ab17c9cdbeccc529fea9142529";s:10:"translated";N;s:8:"original";s:5:"Note:";s:15:"gettext_context";s:0:"";}i:364;O:8:"stdClass":6:{s:2:"id";s:4:"7657";s:6:"status";N;s:3:"ctx";s:32:"7d50c82917852d811a095f3d40e076b5";s:10:"translated";N;s:8:"original";s:154:"Deleting a category does not delete the posts in that category. Instead, posts that were only assigned to the deleted category are set to the category %s.";s:15:"gettext_context";s:0:"";}i:365;O:8:"stdClass":6:{s:2:"id";s:4:"7658";s:6:"status";N;s:3:"ctx";s:32:"deb469cd42d482311dd5a8d12ceff58c";s:10:"translated";N;s:8:"original";s:101:"Categories can be selectively converted to tags using the <a href="%s">category to tag converter</a>.";s:15:"gettext_context";s:0:"";}i:366;O:8:"stdClass":6:{s:2:"id";s:4:"7663";s:6:"status";N;s:3:"ctx";s:32:"6ab742d4843ade0d9b31d004a9422d1f";s:10:"translated";N;s:8:"original";s:13:"Please choose";s:15:"gettext_context";s:0:"";}i:367;O:8:"stdClass":6:{s:2:"id";s:4:"7664";s:6:"status";N;s:3:"ctx";s:32:"0034ad449986c5be167d9b76eba1ca53";s:10:"translated";N;s:8:"original";s:164:"Don't see a Search Form you want to use? <a href="https://mycolorpassport.com/nl/wp-admin/post-new.php?post_type=search-filter-widget">Create a new Search Form</a>.";s:15:"gettext_context";s:0:"";}i:368;O:8:"stdClass":6:{s:2:"id";s:4:"7665";s:6:"status";N;s:3:"ctx";s:32:"8ff70cb26fceaddcfbc8b26b45dac93b";s:10:"translated";N;s:8:"original";s:5:"Share";s:15:"gettext_context";s:0:"";}i:369;O:8:"stdClass":6:{s:2:"id";s:4:"7668";s:6:"status";N;s:3:"ctx";s:32:"995b8ae48206399e7a9530a8154fbbd3";s:10:"translated";N;s:8:"original";s:143:"You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.";s:15:"gettext_context";s:0:"";}i:370;O:8:"stdClass":6:{s:2:"id";s:4:"7669";s:6:"status";N;s:3:"ctx";s:32:"8c34b8c1eaba94f7289ab3289a5399fe";s:10:"translated";N;s:8:"original";s:128:"You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.";s:15:"gettext_context";s:0:"";}i:371;O:8:"stdClass":6:{s:2:"id";s:4:"7670";s:6:"status";N;s:3:"ctx";s:32:"b01553c8108d5bf3e207ba994016eaa5";s:10:"translated";N;s:8:"original";s:99:"<a href="https://codex.wordpress.org/Administration_Screens#Comments">Documentation on Comments</a>";s:15:"gettext_context";s:0:"";}i:372;O:8:"stdClass":6:{s:2:"id";s:4:"7671";s:6:"status";N;s:3:"ctx";s:32:"f188c42723fa64437245088764aa39f6";s:10:"translated";N;s:8:"original";s:10:"Permalink:";s:15:"gettext_context";s:7:"comment";}i:373;O:8:"stdClass":6:{s:2:"id";s:4:"7672";s:6:"status";N;s:3:"ctx";s:32:"1d301682c30adc2b1d810668845b0ec8";s:10:"translated";N;s:8:"original";s:5:"Name:";s:15:"gettext_context";s:0:"";}i:374;O:8:"stdClass":6:{s:2:"id";s:4:"7673";s:6:"status";N;s:3:"ctx";s:32:"291e34e3c9e08cab16dc4bc7966407f4";s:10:"translated";N;s:8:"original";s:6:"Email:";s:15:"gettext_context";s:0:"";}i:375;O:8:"stdClass":6:{s:2:"id";s:4:"7674";s:6:"status";N;s:3:"ctx";s:32:"98c3e73b8181c421267443551d9b7cab";s:10:"translated";N;s:8:"original";s:4:"URL:";s:15:"gettext_context";s:0:"";}i:376;O:8:"stdClass":6:{s:2:"id";s:4:"7675";s:6:"status";N;s:3:"ctx";s:32:"8bd016e64e2a4d6979707fadf992be32";s:10: