3bce830e";s:10:"translated";N;s:8:"original";s:30:"Enter your new password below.";s:15:"gettext_context";s:0:"";}i:929;O:8:"stdClass":6:{s:2:"id";s:5:"12289";s:6:"status";N;s:3:"ctx";s:32:"3dbc72ff05b23bf0dd8d0a855401976f";s:10:"translated";N;s:8:"original";s:12:"New password";s:15:"gettext_context";s:0:"";}i:930;O:8:"stdClass":6:{s:2:"id";s:5:"12290";s:6:"status";N;s:3:"ctx";s:32:"325a006364e81a6ab0bc9c161c4e1444";s:10:"translated";N;s:8:"original";s:18:"Strength indicator";s:15:"gettext_context";s:0:"";}i:931;O:8:"stdClass":6:{s:2:"id";s:5:"12291";s:6:"status";N;s:3:"ctx";s:32:"f068e59d3aa86ec4d3b3f4f34e3b38a9";s:10:"translated";N;s:8:"original";s:20:"Confirm new password";s:15:"gettext_context";s:0:"";}i:932;O:8:"stdClass":6:{s:2:"id";s:5:"12293";s:6:"status";N;s:3:"ctx";s:32:"ebf01fbc616ef573eaed8ac9e3039ae0";s:10:"translated";N;s:8:"original";s:14:"Password Reset";s:15:"gettext_context";s:0:"";}i:933;O:8:"stdClass":6:{s:2:"id";s:5:"12294";s:6:"status";N;s:3:"ctx";s:32:"6a5b11356f829655e24243e46a7b22ca";s:10:"translated";N;s:8:"original";s:29:"Your password has been reset.";s:15:"gettext_context";s:0:"";}i:934;O:8:"stdClass":6:{s:2:"id";s:5:"12295";s:6:"status";N;s:3:"ctx";s:32:"3aa121dbaf81817fce0506ce127ca61f";s:10:"translated";N;s:8:"original";s:50:"<strong>ERROR</strong>: Invalid username or email.";s:15:"gettext_context";s:0:"";}i:935;O:8:"stdClass":6:{s:2:"id";s:5:"12337";s:6:"status";N;s:3:"ctx";s:32:"c7c09f781535681688cfaf16fabe0f76";s:10:"translated";N;s:8:"original";s:87:"<strong>ERROR</strong>: The password you entered for the email address %s is incorrect.";s:15:"gettext_context";s:0:"";}i:936;O:8:"stdClass":6:{s:2:"id";s:5:"12342";s:6:"status";N;s:3:"ctx";s:32:"02cff3ed05b16b9cd2e9600a6d91e751";s:10:"translated";N;s:8:"original";s:28:"Welcome to WordPress&nbsp;%s";s:15:"gettext_context";s:0:"";}i:937;O:8:"stdClass":6:{s:2:"id";s:5:"12343";s:6:"status";N;s:3:"ctx";s:32:"9a3233dc0b433f1447b45b235829e36f";s:10:"translated";N;s:8:"original";s:127:"Thank you for updating to the latest version! WordPress %s adds more ways for you to express yourself and represent your brand.";s:15:"gettext_context";s:0:"";}i:938;O:8:"stdClass":6:{s:2:"id";s:5:"12344";s:6:"status";N;s:3:"ctx";s:32:"0fddd3884a08c5223e3865eaeaa816b7";s:10:"translated";N;s:8:"original";s:16:"What&#8217;s New";s:15:"gettext_context";s:0:"";}i:939;O:8:"stdClass":6:{s:2:"id";s:5:"12345";s:6:"status";N;s:3:"ctx";s:32:"d9ea20d53f5089fb51d7eee860116db8";s:10:"translated";N;s:8:"original";s:7:"Credits";s:15:"gettext_context";s:0:"";}i:940;O:8:"stdClass":6:{s:2:"id";s:5:"12346";s:6:"status";N;s:3:"ctx";s:32:"dffa2057378de9653ed1a2a91566d92a";s:10:"translated";N;s:8:"original";s:8:"Freedoms";s:15:"gettext_context";s:0:"";}i:941;O:8:"stdClass":6:{s:2:"id";s:5:"12347";s:6:"status";N;s:3:"ctx";s:32:"13cd65a3ee1cf129dd8a1e5b7962d8ae";s:10:"translated";N;s:8:"original";s:19:"Maintenance Release";s:15:"gettext_context";s:0:"";}i:942;O:8:"stdClass":6:{s:2:"id";s:5:"12348";s:6:"status";N;s:3:"ctx";s:32:"89b615edaedeab58df789dd5e3a74e4a";s:10:"translated";N;s:8:"original";s:50:"<strong>Version %1$s</strong> addressed %2$s bugs.";s:15:"gettext_context";s:0:"";}i:943;O:8:"stdClass":6:{s:2:"id";s:5:"12349";s:6:"status";N;s:3:"ctx";s:32:"cfb669095c507168e163c1bc7a288762";s:10:"translated";N;s:8:"original";s:61:"For more information, see <a href="%s">the release notes</a>.";s:15:"gettext_context";s:0:"";}i:944;O:8:"stdClass":6:{s:2:"id";s:5:"12350";s:6:"status";N;s:3:"ctx";s:32:"0634b96eb573c04e8e1a057c22986e16";s:10:"translated";N;s:8:"original";s:26:"An Update with You in Mind";s:15:"gettext_context";s:0:"";}i:945;O:8:"stdClass":6:{s:2:"id";s:5:"12351";s:6:"status";N;s:3:"ctx";s:32:"0ffd43c4ad8236fb095670ff3dade229";s:10:"translated";N;s:8:"original";s:83:"WordPress 4.8 adds some great new features. Gear up for a more intuitive WordPress!";s:15:"gettext_context";s:0:"";}i:946;O:8:"stdClass":6:{s:2:"id";s:5:"12352";s:6:"status";N;s:3:"ctx";s:32:"93bd7a0590804d9cf2b29a30fcccbabe";s:10:"translated";N;s:8:"original";s:420:"Though some updates seem minor, they&#8217;ve been built by hundreds of contributors with <em>you</em> in mind. Get ready for new features you&#8217;ll welcome like an old friend: link improvements, <em>three</em> new media widgets covering images, audio, and video, an updated text widget that supports visual editing, and an upgraded news section in your dashboard which brings in nearby and upcoming WordPress events.";s:15:"gettext_context";s:0:"";}i:947;O:8:"stdClass":6:{s:2:"id";s:5:"12353";s:6:"status";N;s:3:"ctx";s:32:"c0c40d0d5ca5904f956eec4d7d9698bf";s:10:"translated";N;s:8:"original";s:23:"Exciting Widget Updates";s:15:"gettext_context";s:0:"";}i:948;O:8:"stdClass":6:{s:2:"id";s:5:"12354";s:6:"status";N;s:3:"ctx";s:32:"26a96bcb8c52ba52b49383725b56ca97";s:10:"translated";N;s:8:"original";s:301:"Adding an image to a widget is now a simple task that is achievable for any WordPress user without needing to know code. Simply insert your image right within the widget settings. Try adding something like a headshot or a photo of your latest weekend adventure &mdash; and see it appear automatically.";s:15:"gettext_context";s:0:"";}i:949;O:8:"stdClass":6:{s:2:"id";s:5:"12355";s:6:"status";N;s:3:"ctx";s:32:"485863778a3a2e4fe533e49825fa68d9";s:10:"translated";N;s:8:"original";s:291:"A welcome video is a great way to humanize the branding of your website. You can now add any video from the Media Library to a sidebar on your site with the new Video widget. Use this to showcase a welcome video to introduce visitors to your site or promote your latest and greatest content.";s:15:"gettext_context";s:0:"";}i:950;O:8:"stdClass":6:{s:2:"id";s:5:"12356";s:6:"status";N;s:3:"ctx";s:32:"e29a2a243744ae632063816d90a2ab25";s:10:"translated";N;s:8:"original";s:305:"Are you a podcaster, musician, or avid blogger? Adding a widget with your audio file has never been easier. Upload your audio file to the Media Library, go to the widget settings, select your file, and you&#8217;re ready for listeners. This would be a easy way to add a more personal welcome message, too!";s:15:"gettext_context";s:0:"";}i:951;O:8:"stdClass":6:{s:2:"id";s:5:"12357";s:6:"status";N;s:3:"ctx";s:32:"081c371d466b4043ec7aa0f98ca017a6";s:10:"translated";N;s:8:"original";s:16:"Rich Text Widget";s:15:"gettext_context";s:0:"";}i:952;O:8:"stdClass":6:{s:2:"id";s:5:"12358";s:6:"status";N;s:3:"ctx";s:32:"f62fae8022053edd105f6ca4b16b610a";s:10:"translated";N;s:8:"original";s:331:"This feature deserves a parade down the center of town! Rich-text editing capabilities are now native for Text widgets. Add a widget anywhere and format away. Create lists, add emphasis, and quickly and easily insert links. Have fun with your newfound formatting powers, and watch what you can accomplish in a short amount of time.";s:15:"gettext_context";s:0:"";}i:953;O:8:"stdClass":6:{s:2:"id";s:5:"12359";s:6:"status";N;s:3:"ctx";s:32:"c97545225a5d9285d2f6d9e40c300ae3";s:10:"translated";N;s:8:"original";s:15:"Link Boundaries";s:15:"gettext_context";s:0:"";}i:954;O:8:"stdClass":6:{s:2:"id";s:5:"12360";s:6:"status";N;s:3:"ctx";s:32:"9f8532d45363c6fa3d90d937f23fd2c1";s:10:"translated";N;s:8:"original";s:420:"Have you ever tried updating a link, or the text around a link, and found you can&#8217;t seem to edit it correctly? When you edit the text after the link, your new text also ends up linked. Or you edit the text in the link, but your text ends up outside of it. This can be frustrating! With link boundaries, a great new feature, the process is streamlined and your links will work well. You‚Äôll be happier. We promise.";s:15:"gettext_context";s:0:"";}i:955;O:8:"stdClass":6:{s:2:"id";s:5:"12361";s:6:"status";N;s:3:"ctx";s:32:"3dace184a570d8ea43d5dfef778e453a";s:10:"translated";N;s:8:"original";s:23:"Nearby WordPress Events";s:15:"gettext_context";s:0:"";}i:956;O:8:"stdClass":6:{s:2:"id";s:5:"12362";s:6:"status";N;s:3:"ctx";s:32:"8cf0cbfde9b7a2a95883fb2cbbd795a2";s:10:"translated";N;s:8:"original";s:276:"Did you know that WordPress has a thriving offline community with groups meeting regularly in more than 400 cities around the world? WordPress now draws your attention to the events that help you continue improving your WordPress skills, meet friends, and, of course, publish!";s:15:"gettext_context";s:0:"";}i:957;O:8:"stdClass":6:{s:2:"id";s:5:"12363";s:6:"status";N;s:3:"ctx";s:32:"6317050f0c7179fa8d96510ddba6b1de";s:10:"translated";N;s:8:"original";s:243:"This is quickly becoming one of our favorite features. While you are in the dashboard (because you&#8217;re running updates and writing posts, right?) all upcoming WordCamps and WordPress Meetups &mdash; local to you &mdash; will be displayed.";s:15:"gettext_context";s:0:"";}i:958;O:8:"stdClass":6:{s:2:"id";s:5:"12364";s:6:"status";N;s:3:"ctx";s:32:"48cb02144176e0ef5bc2d78419af7e60";s:10:"translated";N;s:8:"original";s:265:"Being part of the community can help you improve your WordPress skills and network with people you wouldn&#8217;t otherwise meet. Now you can easily find your local events just by logging in to your dashboard and looking at the new Events and News dashboard widget.";s:15:"gettext_context";s:0:"";}i:959;O:8:"stdClass":6:{s:2:"id";s:5:"12365";s:6:"status";N;s:3:"ctx";s:32:"c6670ab0096718874a9d72491540f348";s:10:"translated";N;s:8:"original";s:32:"Even More Developer Happiness %s";s:15:"gettext_context";s:0:"";}i:960;O:8:"stdClass":6:{s:2:"id";s:5:"12366";s:6:"status";N;s:3:"ctx";s:32:"37eec882931a39ba2e835e9af5c4d92d";s:10:"translated";N;s:8:"original";s:36:"More Accessible Admin Panel Headings";s:15:"gettext_context";s:0:"";}i:961;O:8:"stdClass":6:{s:2:"id";s:5:"12367";s:6:"status";N;s:3:"ctx";s:32:"04b876d3282898d1abc55a201c0f0294";s:10:"translated";N;s:8:"original";s:211:"New CSS rules mean extraneous content (like &ldquo;Add New&rdquo; links) no longer need to be included in admin-area headings. These panel headings improve the experience for people using assistive technologies.";s:15:"gettext_context";s:0:"";}i:962;O:8:"stdClass":6:{s:2:"id";s:5:"12368";s:6:"status";N;s:3:"ctx";s:32:"51fdcc731c6c2b1b03b7e431207eb547";s:10:"translated";N;s:8:"original";s:45:"Removal of Core Support for WMV and WMA Files";s:15:"gettext_context";s:0:"";}i:963;O:8:"stdClass":6:{s:2:"id";s:5:"12369";s:6:"status";N;s:3:"ctx";s:32:"791446c040c798e1c7bbeb6bb36dbb90";s:10:"translated";N;s:8:"original";s:242:"As fewer and fewer browsers support Silverlight, file formats which require the presence of the Silverlight plugin are being removed from core support. Files will still display as a download link, but will no longer be embedded automatically.";s:15:"gettext_context";s:0:"";}i:964;O:8:"stdClass":6:{s:2:"id";s:5:"12370";s:6:"status";N;s:3:"ctx";s:32:"fa7e80565c25e8a565d84ff6b66b39cb";s:10:"translated";N;s:8:"original";s:17:"Multisite Updates";s:15:"gettext_context";s:0:"";}i:965;O:8:"stdClass":6:{s:2:"id";s:5:"12371";s:6:"status";N;s:3:"ctx";s:32:"ca165e80f3a49bacb597de835c4e123f";s:10:"translated";N;s:8:"original";s:225:"New capabilities have been introduced to 4.8 with an eye towards removing calls to <code>is_super_admin()</code>. Additionally, new hooks and tweaks to more granularly control site and user counts per network have been added.";s:15:"gettext_context";s:0:"";}i:966;O:8:"stdClass":6:{s:2:"id";s:5:"12372";s:6:"status";N;s:3:"ctx";s:32:"b6b73459ae14e671bada19460e09650e";s:10:"translated";N;s:8:"original";s:26:"Text-Editor JavaScript API";s:15:"gettext_context";s:0:"";}i:967;O:8:"stdClass":6:{s:2:"id";s:5:"12373";s:6:"status";N;s:3:"ctx";s:32:"0b50aefa72382b9ea7c07f2d14928da3";s:10:"translated";N;s:8:"original";s:259:"With the addition of TinyMCE to the text widget in 4.8 comes a new JavaScript API for instantiating the editor after page load. This can be used to add an editor instance to any text area, and customize it with buttons and functions. Great for plugin authors!";s:15:"gettext_context";s:0:"";}i:968;O:8:"stdClass":6:{s:2:"id";s:5:"12374";s:6:"status";N;s:3:"ctx";s:32:"12d020dc7faeb2a3aefa0d162b0cfb93";s:10:"translated";N;s:8:"original";s:17:"Media Widgets API";s:15:"gettext_context";s:0:"";}i:969;O:8:"stdClass":6:{s:2:"id";s:5:"12375";s:6:"status";N;s:3:"ctx";s:32:"dc468e33d5b16227dbf94f863a32c3f3";s:10:"translated";N;s:8:"original";s:380:"The introduction of a new base media widget REST API schema to 4.8 opens up possibilities for even more media widgets (like galleries or playlists) in the future. The three new media widgets are powered by a shared base class that covers most of the interactions with the media modal. That class also makes it easier to create new media widgets and paves the way for more to come.";s:15:"gettext_context";s:0:"";}i:970;O:8:"stdClass":6:{s:2:"id";s:5:"12376";s:6:"status";N;s:3:"ctx";s:32:"46ef7707aa1c7c440876ef16cea03eef";s:10:"translated";N;s:8:"original";s:25:"Customizer Width Variable";s:15:"gettext_context";s:0:"";}i:971;O:8:"stdClass":6:{s:2:"id";s:5:"12377";s:6:"status";N;s:3:"ctx";s:32:"ca130d93ce11a89076a0612d31367810";s:10:"translated";N;s:8:"original";s:196:"Rejoice! New responsive breakpoints have been added to the customizer sidebar to make it wider on high-resolution screens. Customizer controls should use percentage-based widths instead of pixels.";s:15:"gettext_context";s:0:"";}i:972;O:8:"stdClass":6:{s:2:"id";s:5:"12378";s:6:"status";N;s:3:"ctx";s:32:"0a63d89382cd7d951f7bd084540ae67a";s:10:"translated";N;s:8:"original";s:27:"Go to Dashboard &rarr; Home";s:15:"gettext_context";s:0:"";}i:973;O:8:"stdClass":6:{s:2:"id";s:5:"12379";s:6:"status";N;s:3:"ctx";s:32:"a4a5b3d301df354af36884f771c9cb56";s:10:"translated";N;s:8:"original";s:28:"Your browser is out of date!";s:15:"gettext_context";s:0:"";}i:974;O:8:"stdClass":6:{s:2:"id";s:5:"12380";s:6:"status";N;s:3:"ctx";s:32:"c38a9f0445fd5bcaedb4f7fbb353cebd";s:10:"translated";N;s:8:"original";s:111:"It looks like you're using an old version of %s. For the best WordPress experience, please